import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { ActivatedRoute, RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { NavMenuComponent } from './nav-menu/nav-menu.component';
import { HomeComponent } from './home/home.component';
import { CounterComponent } from './counter/counter.component';
import { FetchDataComponent } from './fetch-data/fetch-data.component';
import { SwaggerComponent } from './swagger/swagger.component';
import { AuthorsComponent } from './AuthorController/authors/authors.component';
import { AuthorService } from './Services/AuthorService';
import { CommonModule } from '@angular/common';
import { AuthordetailsComponent } from './AuthorController/authordetails/authordetails.component';

@NgModule({
  declarations: [
    AuthorsComponent,
    AuthordetailsComponent,
    AppComponent,
    NavMenuComponent,
    HomeComponent,
    CounterComponent,
    FetchDataComponent
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    CommonModule,
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([
      {
        path: '', component: AuthorsComponent, pathMatch: 'full', children: [
          {
            path:':id', component: AuthordetailsComponent
          }
      ] },
      { path: 'counter', component: CounterComponent },
      { path: 'fetch-data', component: FetchDataComponent },
      {path: "swagger", component: SwaggerComponent}
    ])
  ],
  providers: [
    AuthorService,
    ActivatedRoute
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
